Modifiers.html.body:
Matching days using modifiersDay modifiers change the aspect of the day cells and allow you to customize the interaction with the calendar. When a modifier matches a specific day, its day cells receive a modifier CSS class, and its name is passed down to the event handlers.Type of modifier matchersThe value of a modifier can be either:a Date object, to match a specific day

a range object with from and to keys, to match a range of days:const range = { 
  from: new Date(2015, 0, 12), 
  to: new Date(2015, 0, 16) 
}
will match the days between the 12th and the 16th of January.
an object with a before and/or after key, to match the days before and/or after the given date:const range = { 
  before: new Date(),
}
The code above will match all the past the days (i.e. the days before today).const range = { 
  after: new Date(2018, 0, 1), 
}
The code above will match all the days after the January, 1st 2018.const range = { 
  after: new Date(2020, 5, 20), 
  before: new Date(2020, 5, 30), 
}
The code above will match all the days between the 30th and the 20th of April 2018.
an object with a daysOfWeek array, to match specific days of week:const weekends = { 
  daysOfWeek: [0, 6],
}
will match all the Sundays (0) and Saturdays (6)
a function taking the day as first argument and return a boolean value. For example:function sundays(day) {
  return day.getDay() === 0;
}
function isFirstOfMonth(day) {
  return day.getDate() === 1;
}
are all valid modifiers.
an array of the above
ExamplesA CSS modifier (as in BEM-like syntax) is added to each day cell when a day matches a modifier. You set the day modifiers with the selectedDay, disabledDays or modifiers props. Examples:To add a .DayPicker-Day--selected CSS class to the February, 12th 2017 cell:


