DateUtils.html.body:
DateUtilsDateUtils is a set of functions useful to work with dates and modifiers.import { DateUtils } from "react-day-picker";
console.log(DateUtils.isPastDay(new Date())); // false
FunctionsaddMonths (d: Date, n: Number) ⇒ DateReturn d as a new date with n months added. Missing days will be added to the final date, e.g. 2016-03-31 + 1 month = 2016-05-01 (the 31th of April is missing).clone (d: Date) ⇒ DateClone the date d returning a new date with the same time.isDayAfter (day1: ?Date, day2: ?Date) ⇒ BoolReturn true if the first day is after the second day.isDayBefore (day1: ?Date, day2: ?Date) ⇒ BoolReturn true if the first day is before the second day.isSameDay (day1: ?Date, day2: ?Date) ⇒ BoolReturn true if day1 and day2 are the same day.isPastDay (day: Date) ⇒ BoolReturns true if day is in the past, e.g. is yesterday or any day before yesterday.isFutureDay (day: Date) ⇒ BoolReturns true if day is in the future, e.g. is tomorrow or any day after tomorrow.isDayBetween (day: Date, day1: Date, day2: Date) ⇒ BoolReturns true if day is between the days day1 and day2, without including those days.addDayToRange (day: Date, range: ?object) ⇒ ObjectAdd day to a range of days, returning a new range including that day. A range is an object with from and to keys.See the range example for an example using this function.import { DateUtils } from "react-day-picker";

const range = {
  from: new Date(2015, 5, 14),
  to: new Date(2015, 5, 18)
}
const newRange = DateUtils.addDayToRange(new Date(2015, 5, 24), range);

console.log(newRange.from) // 2015-05-24
isDayInRange (day: Date, range: object) ⇒ BoolReturns true if day is included in the specified range of days.  See the range example for an example using this function.getWeekNumber (day: Date) ⇒ NumberReturns the year's week number (as per ISO, i.e. with the week starting from Monday) for the given day.

LocaleUtils.html.body:
LocaleUtilsLocaleUtils is a set of functions used to localize the component (see: Advanced localization). You may want to implement your own LocaleUtils, or override some of its functions.Usually you won't need to use these functions. The component can be localized using months, weekdaysLong, weekdaysShort and firstDayOfWeek props.For example, this code renders the month's title as M/YYYY instead of the default:import DayPicker, { LocaleUtils } from "react-day-picker";

function formatMonthTitle(d, locale) {
 return `${d.getMonth() + 1}/${d.getFullYear}`
}



FunctionsformatDay (d: Date, locale: String) ⇒ StringFormat the string used as aria-label for the given day.formatMonthTitle (d: Date, locale: String) ⇒ StringReturn the string used to format the month's title in the Day Picker for the given date d.formatWeekdayShort (i: number, locale: String) ⇒ StringReturn the string used to render the weekday's short name, e.g. Mo for Monday.formatWeekdayLong (i: number, locale: String) ⇒ StringReturn the string used to render the weekday's long name (starting from 0 as Sunday).getFirstDayOfWeek (locale: String) ⇒ NumberReturn the first day of the week for the given locale (starting from 0 as Sunday).getMonths (locale: String) ⇒ ArrayReturn the twelve months for the given locale (full name, e.g. January).
